import React from "react";
import ProjectCard from "Components/Card/index";

interface Props {
	cards: Array<{
		id: string;
		category: string;
		title: string;
		src: string;
		content: string;
		tags: Array<string>;
	}>;
}

const ProjectsPresenter = ({ workingCards }: Props) => {
	return (
		<div className="container container--card">
			<div className="content-wrap">
				<ProjectCard
					id={workingCards.id}
					category={workingCards.category}
					src={workingCards.src}
					title={workingCards.title}
					content={workingCards.content}
					tags={workingCards.tags}
				/>
			</div>
		</div>
	);
};

export default ProjectsPresenter;
